import React from "react";
import { useSelector } from "react-redux";
import HomePresenter from "./HomePresenter";
import { RootReducerType } from "../../reducers/rootReducer";

interface Cards {
	workingCards: Array<{
		id: string;
		category: string;
		title: string;
		src: string;
		content: string;
		tags: Array<string>;
		participants: string;
		period: string;
		pages: string;
		link: string;
		items: Array<{
			title: string;
			content: string;
		}>;
	}>;

	toyCards: Array<{
		id: string;
		category: string;
		title: string;
		src: string;
		content: string;
		tags: Array<string>;
		participants: string;
		period: string;
		pages: string;
		link: string;
		items: Array<{
			title: string;
			content: string;
		}>;
	}>;
}

const HomeContainer: React.VFC = () => {
	const cardData: Cards = useSelector(
		(state: RootReducerType) => state.cardReducer
	);

	const test: string[] = [];
	const workingTags = cardData.workingCards.map((item) =>
		test.push(...item.tags)
	);

	// console.log(cardData.workingCards);
	console.log(test);

